import React from 'react';

import ProductListComponent from './components/product/ProductListComponent'

import 'bootstrap/dist/css/bootstrap.css'

function App() {

  const divStyle = {
    width: '400px',
    height: '400px'
  }

  return (
    <div className={divStyle}>
      <ProductListComponent />
    </div>
  );
}

export default App;
